function App(){
  return (
    <div className = 'app-container'>
      <form className = "note-form">
        <div><input placeholder = "Note Title"></input></div>
        <div><textarea></textarea></div>
      </form>
      <div className = "note-individual">
        <button>x</button>
        <h2>1st Note Title</h2>
        <p>1st Note Content</p>
        <p>1st Note Label</p>
      </div>
    </div>
  );
}

export default App;
